    public int numMatchingSubseq(String S, String[] words) {
        Map<Character, List<Integer>> charOrderMap = new HashMap<>();
        for(int i=0; i < S.length(); i++) {
            char c = S.charAt(i);
            List<Integer> set = charOrderMap.get(c);
            if(set == null) {
                set = new ArrayList<>();
                charOrderMap.put(c, set);
            }
            set.add(i);
        }
        int result = 0;
        for(String word : words) {
//            System.out.println(word);
            int prevCharPosition = -1;
            Map<Character, List<Integer>> map2 = new HashMap<>();
            boolean ok = true;
            for(int i=0 ; i < word.length(); i++) {
                if(!map2.containsKey(word.charAt(i))) {
                    List<Integer> list =  charOrderMap.get(word.charAt(i));
                    map2.put(word.charAt(i), list == null ? null : new ArrayList<>(list)); 
                }
                List<Integer> list =  map2.get(word.charAt(i));
                if(list == null || list.isEmpty()) {
                    ok = false;
                    break;
                }
                int currPos = list.remove(0);
                while(currPos < prevCharPosition &&  !list.isEmpty()) {
                    currPos = list.remove(0); 
                }
                
                if(prevCharPosition > currPos) {
                    ok = false;
                    break;
                }
                prevCharPosition = currPos;
            }
//            System.out.println("\t"+ok);
            if(ok) {
                result ++;
            }
        }
        
        return result;
    }
